import Layout from "../components/Layout";

import { Grid, Typography, Paper } from "@material-ui/core";

const About = () => (
  <Layout>
    <Grid container>
      <Grid item lg={2}></Grid>

      <Grid item lg={8}>
        <Paper
          square
          elevation={0}
          style={{
            marginTop: 60,
            backgroundColor: "#eee",
            height: "100vh",
          }}
        >
          <Typography variant="h2">About Tomato</Typography>
        </Paper>
      </Grid>

      <Grid item lg={2}></Grid>
    </Grid>
  </Layout>
);

export default About;
